/*Table structure for table `allpcdata1` */

DROP TABLE IF EXISTS `allpcdata1`;

CREATE TABLE `allpcdata1` (
  `pid` int NOT NULL AUTO_INCREMENT,
  `id` varchar(20) DEFAULT NULL,
  `name` varchar(20) DEFAULT NULL,
  `designation` varchar(20) DEFAULT NULL,
  `dept` varchar(20) DEFAULT NULL,
  `mid` varchar(20) DEFAULT NULL,
  `ip` varchar(20) DEFAULT NULL,
  `fklid` varchar(20) DEFAULT NULL,
  `hdd` varchar(10) DEFAULT NULL,
  `mboard` varchar(20) DEFAULT NULL,
  `ram` varchar(10) DEFAULT NULL,
  `chip` varchar(30) DEFAULT NULL,
  `pcstatus` varchar(20) DEFAULT NULL,
  `nstatus` varchar(20) DEFAULT NULL,
  `date` datetime DEFAULT NULL,
  PRIMARY KEY (`pid`)
) ENGINE=InnoDB DEFAULT CHARSET=latin1;

/*Data for the table `allpcdata1` */

/*Table structure for table `demand_note` */

DROP TABLE IF EXISTS `demand_note`;

CREATE TABLE `demand_note` (
  `dmndID` int NOT NULL AUTO_INCREMENT,
  `ddn_no` int DEFAULT NULL,
  `demandDate` varchar(20) DEFAULT NULL,
  `nameOfApplicant` varchar(60) DEFAULT NULL,
  `department` varchar(60) DEFAULT NULL,
  `desigWithId` varchar(50) DEFAULT NULL,
  `submitedTo` varchar(50) DEFAULT NULL,
  `type` varchar(20) DEFAULT NULL,
  PRIMARY KEY (`dmndID`)
) ENGINE=InnoDB AUTO_INCREMENT=8 DEFAULT CHARSET=latin1;

/*Data for the table `demand_note` */


/*Table structure for table `demand_note_sub` */

DROP TABLE IF EXISTS `demand_note_sub`;

CREATE TABLE `demand_note_sub` (
  `sl` int NOT NULL AUTO_INCREMENT,
  `ddn_no` int NOT NULL,
  `description` longtext,
  `brand` varchar(50) DEFAULT NULL,
  `model` varchar(50) DEFAULT NULL,
  `weight` int DEFAULT NULL,
  `pcs` int DEFAULT NULL,
  `partsno` int DEFAULT NULL,
  `location` varchar(50) DEFAULT NULL,
  `remarks` varchar(250) DEFAULT NULL,
  `status` varchar(20) DEFAULT NULL,
  `type` varchar(20) DEFAULT NULL,
  PRIMARY KEY (`sl`)
) ENGINE=InnoDB AUTO_INCREMENT=21 DEFAULT CHARSET=latin1;

/*Data for the table `demand_note_sub` */


/*Table structure for table `deptlist` */

DROP TABLE IF EXISTS `deptlist`;

CREATE TABLE `deptlist` (
  `dept_id` varchar(50) DEFAULT NULL,
  `dept` varchar(50) DEFAULT NULL
) ENGINE=InnoDB DEFAULT CHARSET=latin1;

/*Data for the table `deptlist` */


/*Table structure for table `empdata` */

DROP TABLE IF EXISTS `empdata`;

CREATE TABLE `empdata` (
  `id` varchar(50) NOT NULL DEFAULT '',
  `emp_name` varchar(50) DEFAULT NULL,
  `emp_designation` varchar(100) CHARACTER SET latin1 COLLATE latin1_swedish_ci DEFAULT NULL,
  `dept` varchar(100) CHARACTER SET latin1 COLLATE latin1_swedish_ci DEFAULT NULL,
  `date` datetime DEFAULT NULL,
  `pvs_extension` varchar(50) DEFAULT 'N/A',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=latin1;

/*Data for the table `empdata` */


/*Table structure for table `empdata2` */

DROP TABLE IF EXISTS `empdata2`;

CREATE TABLE `empdata2` (
  `eid` int NOT NULL AUTO_INCREMENT,
  `id` varchar(20) DEFAULT NULL,
  `name` varchar(20) DEFAULT NULL,
  `designation` varchar(20) DEFAULT NULL,
  `dept` varchar(20) DEFAULT NULL,
  `date` datetime DEFAULT NULL,
  UNIQUE KEY `eid` (`eid`)
) ENGINE=InnoDB DEFAULT CHARSET=latin1;

/*Data for the table `empdata2` */

/*Table structure for table `history` */

DROP TABLE IF EXISTS `history`;

CREATE TABLE `history` (
  `sl` int NOT NULL AUTO_INCREMENT,
  `fklid` varchar(50) DEFAULT NULL,
  `ip` varchar(50) DEFAULT NULL,
  `mid` varchar(50) DEFAULT NULL,
  `mtype` varchar(50) DEFAULT NULL,
  `hdd` varchar(50) DEFAULT NULL,
  `mboard` varchar(50) DEFAULT NULL,
  `ram` varchar(50) DEFAULT NULL,
  `chip` longtext,
  `pid` int DEFAULT NULL,
  `id` varchar(50) DEFAULT NULL,
  `img_date` varchar(50) DEFAULT NULL,
  `img_loc` varchar(50) DEFAULT NULL,
  `emp_name` varchar(50) DEFAULT NULL,
  `emp_designation` varchar(50) DEFAULT NULL,
  `handover_date` varchar(50) DEFAULT NULL,
  `dept` varchar(50) DEFAULT NULL,
  `pcstatus` varchar(50) DEFAULT NULL,
  `nstatus` varchar(50) DEFAULT NULL,
  `date` date NOT NULL,
  `remarks` longtext,
  `note` longtext,
  `action_by_user` varchar(30) DEFAULT NULL,
  `action_take_by_pc` varchar(30) DEFAULT NULL,
  PRIMARY KEY (`sl`)
) ENGINE=InnoDB AUTO_INCREMENT=2732 DEFAULT CHARSET=latin1;

/*Data for the table `history` */


/*Table structure for table `image_upload` */

DROP TABLE IF EXISTS `image_upload`;

CREATE TABLE `image_upload` (
